import React from "react";
import { Link, withRouter } from "react-router-dom";

const Navbar = props => {
  return (
    <ul>
      <Link to="/webplayer">
        <li>Home</li>
      </Link>
      <Link to="/playlists">
        <li>Rappers</li>
      </Link>
      <Link to="/signup">
        <li>Sign Up</li>
      </Link>
      <Link to="/login">
        <li>Log In</li>
      </Link>
      <li
        onClick={() => {
          localStorage.removeItem("token");
          props.history.push("/signup");
        }}
      >
        Log Out
      </li>
    </ul>
  );
};

export default withRouter(Navbar);
